import './App.css';
import Navbar from './componets/Navbar'
import Footer from './componets/Footer'
import Check from './componets/check'
import About from './componets/about'
function App() {
  return (
    <>
      <Navbar />
      <Suspense>
      <Check />
      </Suspense>
      <About/>
      <Footer />
    </>
  );
}

export default App;
